# Given string S and a dictionary of words words, find the number of words[i] that is a subsequence of S.
#
# Example :
# Input:
# S = "abcde"
# words = ["a", "bb", "acd", "ace"]
# Output: 3
# Explanation: There are three words in words that are a subsequence of S: "a", "acd", "ace".

class Solution(object):
    def numMatchingSubseq(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        """
        subsequence_count = 0
        subsequences = {}

        #Find distinct subsequences
        for word in words:
            if word not in subsequences:
                subsequences[word] = 1
            else:
                subsequences[word] += 1

        for key, value in subsequences.items():
            subsequence = list(key)
            begin = 0
            end = len(S)
            present = False
            counter = 0
            character = subsequence[counter]

            for i, j in enumerate(S[begin:end]):
                if j is character:
                    begin = i+1
                    counter += 1

                    if counter < len(subsequence):
                        character = subsequence[counter]
                    else:
                        present = True
                        break
            if present:
                subsequence_count += value

        print(subsequence_count)
        return subsequence_count






my_sol = Solution()

S1 = "abcde"
words1 = ["a", "bb", "acd", "ace"]
my_sol.numMatchingSubseq(S1, words1)


